import React from "react";
import "./App.css";

function Nav() {
  return (
    <div className="navcontainer">
      <ul>
        <li>about us</li>
        <li>blog</li>
        <li>document</li>
        <li>store</li>
      </ul>
    </div>
  );
}
export default Nav;
